const Post = ({ postData }) => {
    return (
        <div className="card mt-4">
            <div className="card-body">


                {/* profile details */}
                <div className="media">
                    <img src={postData.user_pic} alt="" className="link-icon link-radius" />
                    <div className="media-body mt-">
                       <h6> {postData.user_name}</h6>
                        <br />
                        <span className="text-secondary">{postData.user_posted_on}</span>
                    </div>
                </div>
                {postData.user_name}
                <br />
                {postData.post_desc}
            </div>
        </div>
    );
};
export default Post;
